	add("pornification", "{\"term\":\"pornification\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|porn|ification|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Alteration to the style or level of pornography\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2006\u0027\u0027, Ariel Levy, \u0027Female Chauvinist Pigs: Women and the Rise of Raunch Culture\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Today\u0027s young women seem to be outdoing the male chauvinist pigs of yesteryear, applauding the \u0026quot;\u0027\u0027pornification\u0027\u0027\u0026quot; of other women\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2007\u0027\u0027, Susanna Paasonen, Kaarina Nikunen, Laura Saarenmaa, \u0027Pornification: Sex and Sexuality in Media Culture\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Perhaps the logical destination of this process of \u0027\u0027pornification\u0027\u0027 is the increasing production of X-rated music videos, that is to say, explicit versions\", \"priority\":5}]}, \"synonyms\":{}}");

	add("pornobilly", "{\"term\":\"pornobilly\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{blend|porn|rockabilly|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A genre of rockabilly music with raunchy lyrics and stylings\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2000\u0027\u0027, Brian Hinton, \u0027Country Roads: How Country Came to Nashville\u0027, Sanctuary (2000), ISBN 9781860742934, [https://books.google.com/books?id\u003dwz4UAQAAIAAJ\u0026amp;q\u003dpornobilly page 423\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Inventor of \u0027\u0027pornobilly\u0027\u0027, Buck would come on stage dressed only in a “cowboy hat, pink cowboy boots and a toilet-plunger codpiece”\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2005\u0027\u0027, \u0027Lost in the Grooves: Scram\u0027s Capricious Guide to the Music You Missed\u0027 (eds. Kim Cooper \u0026amp; David Smay), Routledge (2005), ISBN 9781135879211, [https://books.google.com/books?id\u003djFKsR0K82hYC\u0026amp;pg\u003dPT133\u0026amp;dq\u003dpornobilly unnumbered page\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Of course, there\u0027s a tendency to dismiss Buck and the Boys, \u0027\u0027pornobilly\u0027\u0027 as a cheap novelty\", \"priority\":5}]}, \"synonyms\":{}}");

