	add("pornography", "{\"term\":\"pornography\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\", \"ancient greek (to 1453)\"], \"text\":\"From French \u0027pornographie\u0027 from Ancient greek (to 1453) \u0027πορνογράφος\u0027 from \u0027πόρνη\u0027 (prostitute) + \u0027γράφω\u0027 (i write)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The explicit depiction of sexual subject matter; a display of material of an erotic nature\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"quot;\u0027What is pornography to one man, is the laughter of genius to another.\u0027\u0026quot; by D.H. Lawrence as cited on page 10\u0027s \u0026quot;[http://www.jstor.org/pss/4506223 Confining the Pornography Dragon]\u0026quot; by The Cambridge Law Journal in issue 1980\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Was the \u0027\u0027pornography\u0027\u0027 hetero or gay\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The graphic, detailed, often gratuitous depiction of something\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"In\u0027 The Four Pillars of Wisdom, \u0027he devotes a well-deserved chapter to the financial press and its weakness for \u0026quot;financial \u0027\u0027pornography\u0027\u0027\u0026quot;—lurid coverage of star money managers.\u0027 (\u0027Seattle Times\u0027, August 4, 2002)\u0026lt;!--Several more examples in Word Spy ISBN 0-7679-1466-X--\u0026gt\", \"priority\":5}]}, \"synonyms\":{}}");

	add("pornonormativity", "{\"term\":\"pornonormativity\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|porno|normativity|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The phenomenon of human sexual expression being shaped by the conventions of mainstream pornography\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2010\u0027\u0027, Alison Rooke and Mónica G. Moreno Figueroa, \u0026quot;Beyond \u0027Key Parties\u0027 and \u0027Wife Swapping\u0027: The Visual Culture of Online Swinging\u0026quot;, in \u0027Porn.com: Making Sense of Online Pornography\u0027 (ed. Feona Attwood), Peter Lang (2010), ISBN 9781433102066, [http://books.google.com/books?id\u003dRNprMCakFf8C\u0026amp;pg\u003dPA234\u0026amp;dq\u003d%22pornonormativit\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"page 234\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Female same-sex sexuality is represented in ways which are circumscribed by the conventions of \u0027\u0027pornonormativity\u0027\u0027 and heteroflexibility\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"2010\u0027\u0027, Hastings Donnan \u0026amp; Fiona Magowan, \u0027The Anthropology of Sex\u0027, Berg (2010), ISBN 9781845201135, [http://books.google.com/books?id\u003d2gustlOCpoEC\u0026amp;pg\u003dPA146\u0026amp;dq\u003d%22pornonormativity+%2\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22pornonormativity%20%22\u0026amp;f\u003dfalse page 146\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Sadomasochism has been analyzed in recent times by sociologists, social psychologists and others in terms of \u0027\u0027pornonormativity\u0027\u0027, i.e. sexual scripts derived from images and narratives of porn\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"2011\u0027\u0027, Susanna Paasonen, \u0027Carnal Resonance: Affect and Online Pornography\u0027, MIT Press (2011), ISBN 9780262016315, [http://books.google.com/books?id\u003d2wqbC17l5iUC\u0026amp;pg\u003dPA121\u0026amp;dq\u003d%22pornonormativity+%22 page 121\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Don Slater makes use of a similar term, \u0026quot;pornonormativity,\u0026quot; when discussing the repetition of heterporn conventions in IRC porn exchanges. The aspects of \u0026quot;\u0027\u0027pornonormativity\u0027\u0027\u0026quot; include the recycling of sex acts, body types, fetishes, and kinks familiar from so-called mainstream porn, deeply gendered self-representatives (\u0026quot;young blonde bombshells and well-hung dudes\u0026quot\", \"priority\":9}]}, \"synonyms\":{}}");

	add("pornophobe", "{\"term\":\"pornophobe\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{confix|porno|phobe|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A person opposed to or that hates pornography and sexuality in the art\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1998\u0027\u0027 A Sexual Odyssey\u0026lt;!---[http://books.google.com/books?id\u003dfUifDVRj3cQC\u0026amp;q\u003dpornophobe\u0026amp;dq\u003dpornophobe\u0026amp;hl\u003den\u0026amp;ei\u003dWAGUTuqFD4XliAK9kZCEBQ\u0026amp;sa\u003dX\u0026amp;oi\u003dbook_result\u0026amp;ct\u003dresult\u0026amp;resnum\u003d3\u0026amp;ved\u003d0CDUQ6AEwAg]---\u0026gt\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Depictions of nude and seminude bodies are favorite targets of the \u0027\u0027pornophobes\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2004\u0027\u0027 Unrepentant Whore\u0026lt;!---[http://books.google.com/books?id\u003dPthxt1aCnFEC\u0026amp;pg\u003dPA30\u0026amp;dq\u003dpornophobe\u0026amp;hl\u003den\u0026amp;ei\u003dWAGUTuqFD4XliAK9kZCEBQ\u0026amp;sa\u003dX\u0026amp;oi\u003dbook_result\u0026amp;ct\u003dresult\u0026amp;resnum\u003d8\u0026amp;ved\u003d0CEwQ6AEwBw]---\u0026gt\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The slut radicals abhor the \u0027\u0027pornophobes\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2005\u0027\u0027 Is Fashion A Woman\u0027s Right?\u0026lt;!---[http://books.google.com/books?id\u003dMMufHbvNm20C\u0026amp;pg\u003dPA164\u0026amp;dq\u003dpornophobe\u0026amp;hl\u003den\u0026amp;ei\u003dWAGUTuqFD4XliAK9kZCEBQ\u0026amp;sa\u003dX\u0026amp;oi\u003dbook_result\u0026amp;ct\u003dresult\u0026amp;resnum\u003d4\u0026amp;ved\u003d0CDkQ6AEwAw]---\u0026gt\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The ultra-libertarian and the \u0027\u0027ultra-pornophobe\u0027\u0027 share one opinion: that it is almost, if not quite, impossible to distinguish between what is pornography and what isn\u0027t\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Larry Flynt fought against \u0027\u0027pornophobes\u0027\u0027 when he took his obscenity lawsuit all the way to the Supreme Court and won\", \"priority\":8}]}, \"synonyms\":{}}");

	add("pornophobia", "{\"term\":\"pornophobia\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{confix|porno|phobia|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Dislike, disapproval, fear, intolerance, or animosity and hatred toward sexuality, pornography, nakedness, nude art, and sexual imagery or tex\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1968\u0027\u0027 Quest\u0026lt;!---[http://books.google.com/books?id\u003dVkwZAAAAIAAJ\u0026amp;q\u003dpornophobia\u0026amp;dq\u003dpornophobia\u0026amp;hl\u003den\u0026amp;ei\u003dCv-TTv_iA9LPiALcmpmFBQ\u0026amp;sa\u003dX\u0026amp;oi\u003dbook_result\u0026amp;ct\u003dresult\u0026amp;resnum\u003d6\u0026amp;ved\u003d0CEEQ6AEwBQ]---\u0026gt\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Fear of pronography, or \u0027\u0027 \u0027pornophobia\u0027 \u0027\u0027 as I choose to call it, is a terribly unbalancing mental condition\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1995\u0027\u0027 Read, reason, write\u0026lt;!---[http://books.google.com/books?id\u003dcEWqMBiLRw8C\u0026amp;q\u003dpornophobia\u0026amp;dq\u003dpornophobia\u0026amp;hl\u003den\u0026amp;ei\u003dCv-TTv_iA9LPiALcmpmFBQ\u0026amp;sa\u003dX\u0026amp;oi\u003dbook_result\u0026amp;ct\u003dresult\u0026amp;resnum\u003d3\u0026amp;ved\u003d0CDUQ6AEwAg]---\u0026gt\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The Perils of \u0027\u0027Pornophobia\u0027\u0027 Nadine Strossen Earning her law degree at Harvard University\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2004\u0027\u0027 Unrepentant Whore\u0026lt;!---[http://books.google.com/books?id\u003dPthxt1aCnFEC\u0026amp;pg\u003dPA30\u0026amp;dq\u003dpornophobia\u0026amp;hl\u003den\u0026amp;ei\u003dCv-TTv_iA9LPiALcmpmFBQ\u0026amp;sa\u003dX\u0026amp;oi\u003dbook_result\u0026amp;ct\u003dresult\u0026amp;resnum\u003d7\u0026amp;ved\u003d0CEUQ6AEwBg]---\u0026gt\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"I don\u0027t want to fight my sisters, and \u0027\u0027pornophobia\u0027\u0027 is not quite a recognized social ill at this point, so I just better relax\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"2007\u0027\u0027 Pornology\u0026lt;!---[http://books.google.com/books?id\u003dIAI5cHdGlmcC\u0026amp;pg\u003dPA13\u0026amp;dq\u003dpornophobia\u0026amp;hl\u003den\u0026amp;ei\u003dCv-TTv_iA9LPiALcmpmFBQ\u0026amp;sa\u003dX\u0026amp;oi\u003dbook_result\u0026amp;ct\u003dresult\u0026amp;resnum\u003d9\u0026amp;ved\u003d0CE8Q6AEwCA]---\u0026gt\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"“\u0027\u0027Pornophobic\u0027\u0027?” That\u0027s his response to my impassioned arguments about why porn is anti-feminist and misogynistic\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Some feminists laugh at claims of \u0027\u0027pornophobia\u0027\u0027 for their opposition to porn and art, but this is something third wave feminists do recognize\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"Fear of prostitute\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"1994\u0027\u0027 Uncontrollable Bodies\u0026lt;!---[http://books.google.com/books?id\u003dzL0zAQAAIAAJ\u0026amp;q\u003dpornophobia\u0026amp;dq\u003dpornophobia\u0026amp;hl\u003den\u0026amp;ei\u003dCv-TTv_iA9LPiALcmpmFBQ\u0026amp;sa\u003dX\u0026amp;oi\u003dbook_result\u0026amp;ct\u003dresult\u0026amp;resnum\u003d10\u0026amp;ved\u003d0CFQQ6AEwCQ]---\u0026gt\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"Pornophobia\u0027\u0027 means the fear of prostitutes\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"A lot of medics from Asia and Africa bring backward attitudes with them into the workplace leading to poor treatment of sex workers because of their \u0027\u0027pornophobia\u0027\u0027 making them uncomfortable dealing and effectively discussing important medical concerns such as condom usage, STD treatment, and prevention\", \"priority\":14}]}, \"synonyms\":{}}");

