	add("portal", "{\"term\":\"portal\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"From \u0027portale\u0027, from Latin \u0027porta\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A grandiose and often lavish entrance\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Milto\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Thick with sparkling orient gems / The \u0027\u0027portal\u0027\u0027 shone\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"An entrance, entry point, or means of entry\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The local library, a \u0027\u0027portal\u0027\u0027 of knowledge\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A website that acts as an entrance to other websites on the Internet\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The new medical \u0027\u0027portal\u0027\u0027 has dozens of topical categories containing links to hundreds of sites\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"A short vein that carries blood into the liver\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"A magical or technological leading to another location, period in time or dimension\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"A lesser gate, where there are two of different dimensions\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"Formerly, a small square corner in a room separated from the rest of an apartment by wainscoting, forming a short passage to another apartment\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"The space, at one end, between opposite trusses when these are terminated by inclined braces\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"A prayer book or breviary; a portass\", \"priority\":13}]}, \"synonyms\":{}}");

