	add("portfolio", "{\"term\":\"portfolio\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Italian\"], \"text\":\"From Italian \u0027portafoglio\u0027 cognate with the French \u0027portefeuille\u0027 (\u0026quot;folder, wallet\u0026quot;), from the Latin verb \u0027\u0027 (\u0026quot;to carry\u0026quot;) and \u0027\u0027 (\u0026quot;sheet\u0026quot;). The meaning \u0026quot;collection of responsibilities\u0026quot; came by extension in the 1930s.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A case for carrying papers, drawings, photographs, maps and other flat documents\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The collection of such documents, especially the works of an artist or photographer\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The post and the responsibilities of a cabinet minister or other head of a government department\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The group of investments and other assets held by an investor\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://www.economist.com/news/finance-and-economics/21579879-buy-out-firm-really-does-focus-operational-improvements-engineers Engineers of a different passage\u003dPrivate-equity nabobs bristle at being dubbed mere financiers.Much of their pleading is public-relations bluster. Clever financial ploys are what have made billionaires of the industry’s veterans. “Operational improvement” in a \u0027\u0027portfolio\u0027\u0027 company has often meant little more than promising colossal bonuses to sitting chief executives if they meet ambitious growth targets. That model is still prevalent today\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A collection of assets generally\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"I would like to introduce you to our \u0027\u0027portfolio\u0027\u0027 of services\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"a range of products - a product \u0027\u0027portfolio\", \"priority\":8}]}, \"synonyms\":{}}");

