	add("portion", "{\"term\":\"portion\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle english (1100-1500)\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Middle english (1100-1500) \u0027porcioun\u0027 from Old french (842-ca. 1400) \u0027porcion\u0027 () from Latin \u0027portio\u0027 (a share, part, portion, relation, proportion) akin to \u0027pars\u0027 () see part. Compare proportion.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An allocated amount\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"That which is divided off or separated, as a part from a whole; a separated part of anything\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"One\u0027s fate; lot\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Bible, Luke xii. 4\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The lord of that servant will appoint him his \u0027\u0027portion\u0027\u0027 with the unbelievers\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Man\u0027s \u0027\u0027portion\u0027\u0027 is to die and rise again\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The part of an estate given or falling to a child or heir; an inheritance\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Bible, Luke xv. 1\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Give me the \u0027\u0027portion\u0027\u0027 of goods that falleth to me\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"A wife\u0027s fortune; a dowry\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"1613\u0027\u0027, w: William William Shakespeare, \u0027s: The Two Noble The Two Noble Kinsmen\u0027, V. iv. 31\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"Commend me to her, and to piece her \u0027\u0027portion\u0027\u0027 / Tender her this\", \"priority\":12}]}, \"synonyms\":{}}");

