	add("portrait", "{\"term\":\"portrait\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\", \"Latin\"], \"text\":\"From Middle french (ca. 1400-1600) {{m|frm|portraict}}, {{m|frm|pourtraict}}, nominal use of the past participle of {{m|frm|portraire||portray}}, from Latin {{m|la|prōtrahō}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A painting or other picture of a person, especially the head and shoulders\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Sir J. Reynold\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"In \u0027\u0027portraits\u0027\u0027, the grace, and, we may add, the likeness, consists more in the general air than in the exact similitude of every feature\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"An accurate depiction of a person, a mood, etc\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The author painted a good \u0027\u0027portrait\u0027\u0027 of urban life in New York in his latest book\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A print orientation where the vertical sides are longer than the horizontal sides\", \"priority\":6}]}, \"synonyms\":{}}");

